$(document).ready(function () {
    // $('form input').keydown(function (e) {
    //     if (e.keyCode == 13) {
    //         e.preventDefault();
    //         return false;
    //     }
    // });

    $(".carousel").carousel({
        interval: false,
    });

    $("input[type='file']").on("change", function () {
        readURL(this);
    });
    $("input, select, textarea").on("keyup change", function () {
        $(this)
            .parent()
            .removeClass("has-error")
            .find("code")
            .fadeOut("1000", function () {
                $(this).remove();
            });
    });
    // MetsiMenu
    $("#side-menu").metisMenu();

    imgError();

    $(".modal").on("hidden.bs.modal", function () {
        $(".btn").removeAttr("disabled");
    });

    // Collapse ibox function
    $(".collapse-link").click(function () {
        var ibox = $(this).closest("div.ibox");
        var button = $(this).find("i");
        var content = ibox.find("div.ibox-content");
        content.slideToggle(200);
        button.toggleClass("fa-chevron-up").toggleClass("fa-chevron-down");
        ibox.toggleClass("").toggleClass("border-bottom");
        setTimeout(function () {
            ibox.resize();
            ibox.find("[id^=map-]").resize();
        }, 50);
    });

    // Close ibox function
    $(".close-link").click(function () {
        var content = $(this).closest("div.ibox");
        content.remove();
    });

    // Small todo handler
    $(".check-link").click(function () {
        var button = $(this).find("i");
        var label = $(this).next("span");
        button.toggleClass("fa-check-square").toggleClass("fa-square-o");
        label.toggleClass("todo-completed");
        return false;
    });

    // minimalize menu
    $(".navbar-minimalize").click(function () {
        $("body").toggleClass("mini-navbar");
        SmoothlyMenu();
    });

    // tooltips
    $(".tooltip-demo").tooltip({
        selector: "[data-toggle=tooltip]",
        container: "body",
    });

    // Move modal to body
    // Fix Bootstrap backdrop issu with animation.css
    $(".modal").appendTo("body");

    // Full height of sidebar
    function fix_height() {
        var heightWithoutNavbar = $("body > #wrapper").height() - 61;
        $(".sidebard-panel").css("min-height", heightWithoutNavbar + "px");
    }
    fix_height();

    $(".nav-tabs").addClass("nav-justified");

    $(window).bind("load resize click scroll", function () {
        if (!$("body").hasClass("body-small")) {
            fix_height();
        }
    });

    $("[data-toggle=popover]").popover();

    $(".uang").attr("nowrap", "nowrap");

    $(".angka").keyup(function (e) {
        var before = $(this).val();
        $(this).val(parseInt(before) || "");
    });

    // $("form").on("submit", function () {
    //     $(".btn").attr("disabled", "disabled"); // but this doesn't work
    // });
});

// For demo purpose - animation css script
function animationHover(element, animation) {
    element = $(element);
    element.hover(
        function () {
            element.addClass("animated " + animation);
        },
        function () {
            //wait for animation to finish before removing classes
            window.setTimeout(function () {
                element.removeClass("animated " + animation);
            }, 2000);
        }
    );
}

// Minimalize menu when screen is less than 768px
$(function () {
    $(window).bind("load resize", function () {
        if ($(this).width() < 769) {
            $("body").addClass("body-small");
        } else {
            $("body").removeClass("body-small");
        }
    });
});

function SmoothlyMenu() {
    if (
        !$("body").hasClass("mini-navbar") ||
        $("body").hasClass("body-small")
    ) {
        // Hide menu in order to smoothly turn on when maximize menu
        $("#side-menu").hide();
        // For smoothly turn on menu
        setTimeout(function () {
            $("#side-menu").fadeIn(500);
        }, 100);
    } else if ($("body").hasClass("fixed-sidebar")) {
        $("#side-menu").hide();
        setTimeout(function () {
            $("#side-menu").fadeIn(500);
        }, 300);
    } else {
        // Remove all inline style from jquery fadeIn function to reset menu state
        $("#side-menu").removeAttr("style");
    }
}

// Dragable panels
function WinMove() {
    var element = "[class*=col]";
    var handle = ".ibox-title";
    var connect = "[class*=col]";
    $(element)
        .sortable({
            handle: handle,
            connectWith: connect,
            tolerance: "pointer",
            forcePlaceholderSize: true,
            opacity: 0.8,
        })
        .disableSelection();
}

function validasi(selector, pesan) {
    $(selector).parent().find("code").remove();

    $(selector)
        .parent()
        .addClass("has-error")
        .append("<code>" + pesan + "</code>");

    $(selector).parent().find("code").hide().fadeIn(1000);

    $(selector).focus();

    $(selector).on("keyup change", function () {
        $(this)
            .parent()
            .removeClass("has-error")
            .find("code")
            .fadeOut("1000", function () {
                $(this).remove();
            });
    });
}
